    # ngc_writer.preamble()
    first = True
    # print(toolpath)
    for path in toolpath:
        if len(path) == 0:
            continue
        try:
            if first:
                ngc_writer.pen_up()
                first_pt = path[0]
                ngc_writer.xy_rapid_to(first_pt.x, first_pt.y)
                ngc_writer.pen_down(first_pt.z)
                first = False
            for p in path[1:]:
                ngc_writer.line_to(p.x, p.y, p.z)
        except Exception as e:
            print(e)
            pass
